window.bookSummaryJSON = "<p><b>Damien had planned it all out.</b></p> <p>He had the support of his wealthy parents, loyal friends who shared his goals, even a high-ranked Core just waiting for him to use. One more Dungeon run and he would be set–he was finally going to take the first real step on the path to fame and fortune as a Hero. The future was so bright, he needed shades to see it.</p> <p>Was, in the past tense. Because Damien just died.</p> <p>Instead of the pearly gates awaiting him, though, he's been reborn, placed in control of a Dungeon... and now might be a good time for him to reconsider everything he thought he knew about the way the universe works.</p>"; 
